import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Components/NavBar/Navbar';
import CrearRegistro from './Pages/CrearRegistro';
import ConsultarRegistros from './Pages/ConsultarRegistros';
import ActualizarRegistro from './Pages/ActualizarRegistro';
import EliminarRegistro from './Pages/EliminarRegistro';

function App() {
    return (
        <Router>
            <Navbar />
            <Routes>
                <Route path="/crear" element={<CrearRegistro />} />
                <Route path="/consultar" element={<ConsultarRegistros />} />
                <Route path="/actualizar" element={<ActualizarRegistro />} />
                <Route path="/eliminar" element={<EliminarRegistro />} />
            </Routes>
        </Router>
    );
}

export default App;
